package com.chanyi.model;import java.io.Serializable;/** * 接口表 *  * @author lilei * */public class CustomParamInfo implements Serializable {	private static final long serialVersionUID = -1681983395894810422L;		private String name;		private String type;		private String desc;	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getType() {		return type;	}	public void setType(String type) {		this.type = type;	}	public String getDesc() {		return desc;	}	public void setDesc(String desc) {		this.desc = desc;	}	public static long getSerialversionuid() {		return serialVersionUID;	}	@Override	public String toString() {		return "MethodParamInfo [name=" + name + ", type=" + type + ", desc=" + desc + "]";	}		}